import { AUTH, LOGOUT } from "../constants/actionTypes";

const reducer = (state = [], action) => {
  switch (action.type) {
    case AUTH:
      return state;
    case LOGOUT:
      return [];
    default:
      return state;
  }
};

export default reducer;
